import React, { Component } from 'react';
import './App.css';
import { Route, Link, BrowserRouter as Router} from 'react-router-dom';

class Nav extends Component {

    render(){

    return(

    <div class="nav">

        <div className="navspace">
        Transcribe
        </div>

      <div class="nav2">

        <div className="navspace" >
        <Link to="/students">
        Students
        </Link>
        </div>

        <div className="navspace" >
        <Link to="/lecturers">
        Lecturers/Teachers
        </Link>
        </div>

      </div>

      </div>

    )
    }
}

export default Nav
